import { useState } from "react";
import Menu from "../Menu/Menu";
import Navbar from "../Navbar/Navbar";

const MenuHeader = () => {
  const [active, setActive] = useState(false);
  return (
    <div>
      <Menu />
      <Navbar />
    </div>
  );
};

export default MenuHeader;
